function loadStudentsTable(){$.ajax({type:"GET",url:"http://localhost:3000/api/Student",success:a=>{$("#studentsTable").DataTable({data:a,columns:[{data:"participantNo"},{data:"contact.firstName"},{data:"contact.lastName"},{data:"contact.email"},{data:"college",render:a=>a.substring(a.indexOf("#")+1)},{data:"course",render:a=>a.substring(a.indexOf("#")+1)},{data:"currentCredits"},{data:"graduated"}]})}})}$(()=>{$("body").is(".admin")&&loadStudentsTable()});